import React from 'react';
import TripCard from './TripCard';
import '../styles/TripList.css';

function TripList() {
  const trips = [
    {
      image: 'https://source.unsplash.com/400x300/?mountains',
      title: 'Himalayan Adventure',
      days: 7,
      rating: 4.8,
      price: 499,
    },
    {
      image: 'https://source.unsplash.com/400x300/?beach',
      title: 'Maldives Relaxation',
      days: 5,
      rating: 4.7,
      price: 699,
    },
    {
      image: 'https://source.unsplash.com/400x300/?desert',
      title: 'Dubai Desert Safari',
      days: 4,
      rating: 4.6,
      price: 349,
    },
    {
      image: 'https://source.unsplash.com/400x300/?northern-lights',
      title: 'Aurora Hunt in Iceland',
      days: 6,
      rating: 4.9,
      price: 899,
    },
  ];

  return (
    <section className="trip-list-section">
      <h2>Available Trips</h2>
      <div className="trip-grid">
        {trips.map((trip, index) => (
          <TripCard
            key={index}
            image={trip.image}
            title={trip.title}
            days={trip.days}
            rating={trip.rating}
            price={trip.price}
          />
        ))}
      </div>
    </section>
  );
}

export default TripList;
